import React from "react";

export default function Home() {
  return (
    <>
      <h2>Welcome to Garmin Dashboard</h2>
      <p>Time is {new Date().getDate()}</p>
      <p>Athlete name:</p>
      <p>Other info:</p>
      <img src="/finance-chart.jpg" width="100%" alt="finance chart"/>
    </>
  )
}
